const QsPage = () => {
    const questions = [
      "질문 1",
      "질문 2",
      "질문 3",
      // ...
    ];

    return (
      <div>
        <Navbar></Navbar>
        <div className="question-sheet">
          {questions.map((question, index) => (
            <div className="question" key={index}>
              {index + 1}. {question}
            </div>
          ))}
        </div>
      </div>
    );
  };

  export default QsPage;
